webpackJsonp([296],{"./node_modules/json-loader/index.js!./.cache/json/api-callback-html.json":function(e,a){e.exports={data:{file:{relativePath:"api/Callback.html",childRawHtml:{content:'<div class="ocamldoc">\n<div class="navbar"><a class="pre" href="BytesLabels.html" title="BytesLabels">Previous</a>\n&#xA0;<a class="up" href="index.html" title="Index">Up</a>\n&#xA0;<a class="post" href="CamlinternalFormat.html" title="CamlinternalFormat">Next</a>\n</div>\n<h1>Module <a href="type_Callback.html">Callback</a></h1>\n\n<pre><span class="keyword">module</span> Callback: sig .. end</pre><div class="info module top">\nRegistering OCaml values with the C runtime.\n<p>\n\n   This module allows OCaml values to be registered with the C runtime\n   under a symbolic name, so that C code can later call back registered\n   OCaml functions, or raise registered OCaml exceptions.<br>\n</p></div>\n<hr width="100%">\n\n<pre><span class="keyword">let</span> register: string =&gt; &apos;a =&gt; unit;\n</pre><div class="info ">\n<code class="code">Callback.register n v</code> registers the value <code class="code">v</code> under\n   the name <code class="code">n</code>. C code can later retrieve a handle to <code class="code">v</code>\n   by calling <code class="code">caml_named_value(n)</code>.<br>\n</div>\n\n<pre><span class="keyword">let</span> register_exception: string =&gt; exn =&gt; unit;\n</pre><div class="info ">\n<code class="code">Callback.register_exception n exn</code> registers the\n   exception contained in the exception value <code class="code">exn</code>\n   under the name <code class="code">n</code>. C code can later retrieve a handle to\n   the exception by calling <code class="code">caml_named_value(n)</code>. The exception\n   value thus obtained is suitable for passing as first argument\n   to <code class="code">raise_constant</code> or <code class="code">raise_with_arg</code>.<br>\n</div>\n</div>'}}},pathContext:{relativePath:"api/Callback.html"}}}});
